import "./cliente.css";
import FormDialog from "../dialog/dialog";

export default function Cliente(props) {
  const [open, setOpen] = React.useState(false);

  return (
    <div className="conteudo-lista-cliente">
      <p>{props.id}</p>
      <p>{props.nome}</p>
      <p>{props.email}</p>
      <p>{props.telefone}</p>
    </div>
  );
}
